import React from 'react';
import Media1 from '../components/Media1';
import MapBe from '../components/MapBe'
import { Col, Row, Card } from 'react-bootstrap';


function Home() {
    return (
        <Card style={{ border: "3px #138086 solid", padding: "6px" }}>
            <Row>
                <Col sm={8} ><MapBe /></Col>

                <Col sm={3} style={{ overflowY: ' scroll', backgroundColor: 'lightblue', height: '600px' }}>
                    <Media1 />

                </Col>
            </Row>
        </Card>


    );
}

export default Home;
